const { default: styled } = require('styled-components');

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  margin: 35px;
background-color: red;
`;

export const Wrapper = styled.div`
  display: flex;
  min-width: 300px;
  margin-right: 15px;

`;
